import React, { Component } from 'react'

export default class About extends Component {
  render() {
    return (
      <div>
        <h1>Hi! I'm Kavan Bansal.</h1>
        <h3>I am a third-year undergraduate student at Johns Hopkins</h3>
        <p><h4>Majors:</h4> Computer Science, Computer Engineering</p>
        <p>Minors: Entrepreneurship and Management, Applied Mathematics and Statistics</p>
      </div>
    )
  }
}
